tables.table_schema:
CREATE TABLE users (
    user_id SERIAL PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    email VARCHAR(50) NOT NULL
);

CREATE TABLE user_preferences (
    preference_id SERIAL PRIMARY KEY,
    user_id INT REFERENCES users(user_id),
    category VARCHAR(50) NOT NULL,
    value VARCHAR(50) NOT NULL
);

CREATE TABLE users (user_id INT, name STRING, email STRING, age INT);
CREATE TABLE products (product_id INT, name STRING, category STRING, price DECIMAL);
CREATE TABLE purchases (purchase_id INT, user_id INT, product_id INT, purchase_date DATE);
CREATE TABLE preferences (user_id INT, category STRING, preference_level INT);
